import React from 'react';
import Globe from './Globe';
import './styles.css';
import { Link } from 'react-router-dom';

function MineralsExtraction() {
  return (
    <body>
        <div className="page-container">
        <h1>Energy and Global Warming</h1>
        <p>Explore the impact of energy consumption on global warming.</p>
        <div className="content">
            <Globe />
            <div className="image-container">
            <img src="img/enr.jpeg" alt="Globe" />
            </div>
        </div>
        <div className="navigation-buttons">
            <Link to="/renewable-energy" className="arrow-button">&#8592; Renewable Energy</Link>
            <Link to="/minerals-extraction" className="arrow-button">Minerals Extraction &#8594;</Link>
        </div>
        </div>
        </body>
  );
}

export default MineralsExtraction;
